import React from 'react';
import cat1Image from '../images/cat1.png';
import cat2Image from '../images/cat2.png';
import cat3Image from '../images/cat3.png';
import cat4Image from '../images/cat4.png';

export default function ContentPage() {
  const cardsData = [
    { id: 1, image: cat1Image, text: 'Card 1', buttonLabel: 'Button 1' },
    { id: 2, image: cat2Image, text: 'Card 2', buttonLabel: 'Button 2' },
    { id: 3, image: cat3Image, text: 'Card 3', buttonLabel: 'Button 3' },
    { id: 4, image: cat4Image, text: 'Card 4', buttonLabel: 'Button 4' },
  ];

  return (
    <div className="container mx-auto py-8">
      <div className="grid grid-cols-4 gap-8">
        {cardsData.map((card) => (
          <div key={card.id} className="bg-white rounded-lg shadow-md flex flex-col">
            <div className="relative">
              <img src={card.image} alt={`Image ${card.id}`} className="w-full h-40 object-cover rounded-t-lg" />
              <div className="absolute bottom-0 left-0 right-0 flex justify-center">
                <button className="bg-blue-500 hover:bg-blue-600 text-white font-semibold py-2 px-4 rounded">{card.buttonLabel}</button>
              </div>
            </div>
            <div className="p-4">
              <h3 className="text-lg font-semibold mb-2">{card.text}</h3>
            </div>
          </div>
        ))}
      </div>
    </div>
  );
  
};
